import React from 'react';

import AppBar from 'components/AppBar/AppBar';
import BottomNav from 'components/BottomNav/BottomNav';

const Layout = ({ children, showAppBar = false, showBottomNav = false }) => {
  return (
    <div>
      {
        showAppBar &&
        <AppBar />
      }
      {children}
      {
        showBottomNav &&
        <BottomNav />
      }
    </div>
  )
};

export default Layout;
